import { Component } from "react";
import React from "react";
import { Link } from "react-router-dom";
import { Redirect } from "react-router-dom";
import CardCatalogoEspecifico from "./Cards/CardCatalogoEspecifico";
import todosServicosRequest from "../request/todosServicosRequest";
import { Fragment } from "react";

class CatalogoEspecifico extends React.Component {
  state = {
    servicos: null,
    id: sessionStorage.getItem("IdServico")
  };

  componentDidMount() {
    this.state.servico = this.doRequest();
  }

  doRequest() {
    const request = async () => {
      const response = await fetch(
        `http://localhost:8080/Servicos/Categoria?categoria=${this.state.id}`,
        {
          method: "get"
        }
      );
      const json = await response.json();

      console.log(json);
      return json;
    };
  }

  render() {
    this.getServices();
    return (
      <Fragment>
        <h4 className="text-secondary" align="center">
          Catálogo específico
        </h4>
        <div className="row" align="center">
          {this.state.servicos.map((servico, i) => {
            console.log("Entered");
            return <CardCatalogoEspecifico key={i} servico={servico} />;
          })}
        </div>
      </Fragment>
    );
  }
}

export default CatalogoEspecifico;
